/** @format */

import React from "react";
import styled from "styled-components";

const MenuCardBlock = styled.div`
  width: 90%;
  margin: 0 auto;
  display: flex;
  padding: 2vh 0;
`;
const MenuCardDesc = styled.div`
  flex: 2.5;
`;

const MenuCardImg = styled.div`
  flex: 1;
`;

const MenuCardDescT = styled.div`
  font-weight: bold;
  font-size: 17px;
`;
const MenuCard = () => {
  return (
    <MenuCardBlock>
      <MenuCardDesc>
        <MenuCardDescT>순살양념구이</MenuCardDescT>
      </MenuCardDesc>
      <MenuCardImg>1</MenuCardImg>
    </MenuCardBlock>
  );
};

export default MenuCard;
